function({_req}) {
  const pageIndex = Number(_req.query.pageIndex);
  const pageSize = Number(_req.query.pageSize);
  const start = (pageIndex - 1) * pageSize;
  const offset = pageIndex * pageSize;
  const rows = [];
  for (let i = start; i < offset; i++) {
    const row = {};
    for (let j = 0; j < 30; j++) {
      row[`column_${j}`] = i * (j + 1);
    }
    rows.push(row);
  }
  return {
    currentPage: pageIndex,
    rows,
    count: 4000
  };
}
